import { Heading, Input } from "@chakra-ui/react";

const App = () => {
	return (
		<div className="min-h-screen flex items-center justify-center bg-gray-100">
			<div className="max-w-sm w-full bg-white p-8 rounded shadow-lg">
				<Heading size="lg">Онлайн чат</Heading>
				<div className="mb-4">
					<label className="block text-sm font-medium text-gray-700">
						Имя пользователя
					</label>
					<Input name="username" placeholder="Введите ваше имя" />
				</div>
				<div className="mb-6">
					<label className="block text-sm font-medium text-gray-700">
						Название чата
					</label>
					<Input name="chatname" placeholder="Введите название чата" />
				</div>
				<button className="w-full bg-blue-500 hover:bg-blue-600 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline ">
					Присоединиться
				</button>
			</div>
		</div>
	);
};

export default App;
